import React, { Component } from 'react'

export default class About extends Component {
    render() {
        return (
            <div style={{ height: "100%" }}>
                <h2 className="set-title">关于我</h2>
                <section className="set-content">
                    <div className="set-info">
                        This Is About Page!
                    </div>
                </section>
            </div>
        )
    }
}
